#=============================================#
	# Load PropertyStore .Net lib into memory     #
	# --------------------------------------------#
	# Author => @securifybv/@yorickkoster         #
	# https://github.com/securifybv/PropertyStore #
	# --------------------------------------------#
	# .Net Framework Compat: 4.0+                 #
	#=============================================#
	$EncodedCompressedFile = @'
	
'@
	$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
	$UncompressedFileBytes = New-Object Byte[](13312)
	$DeflatedStream.Read($UncompressedFileBytes, 0, 13312) | Out-Null
	[Reflection.Assembly]::Load($UncompressedFileBytes) | Out-Null
	#=========================================#
	# Load ShellLink .Net lib into memory     #
	# ----------------------------------------#
	# Author => @securifybv/@yorickkoster     #
	# https://github.com/securifybv/ShellLink #
	# ----------------------------------------#
	# .Net Framework Compat: 4.0+             #
	#=========================================#

$EncodedCompressedFile = @'
	
'@
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
	$UncompressedFileBytes = New-Object Byte[](80384)
	$DeflatedStream.Read($UncompressedFileBytes, 0, 80384) | Out-Null
	[Reflection.Assembly]::Load($UncompressedFileBytes) | Out-Null

# Get Current User Recent Files folder contents
$lnkfiles = Get-ChildItem -path "$($env:APPDATA)\Microsoft\Windows\Recent" -Filter *.lnk -Recurse -Force -ErrorAction SilentlyContinue|Select -Property fullname

# Get info from each LNK
$linktargets = foreach($lnkfile in $lnkfiles){ 
             try{ 
                 $ShotcutInfo = [ShellLink.Shortcut]::ReadFromFile($lnkfile.FullName)
                 # Check if target Shortcut is Valid (i.e. exists): Results: True/False or ----
                 try
				{
					if (![String]::IsNullOrEmpty($ShotcutInfo.LinkTargetIDList.Path))
					    { $valid = (Test-Path -LiteralPath $ShotcutInfo.LinkTargetIDList.Path -ErrorAction SilentlyContinue) }
				}
				catch {   $valid = "---" }

                [PSCustomObject]@{
                    'Shortcut File' = Split-Path $lnkfile.FullName -Leaf
                    'Shortcut Size'   = $ShotcutInfo.Size
                    LinkCLSID         = $ShotcutInfo.LinkCLSID
                    'Target File Size'= $ShotcutInfo.FileSize
                    Attributes        = $ShotcutInfo.FileAttributes.ToString()
                    VolumeLabel       = $ShotcutInfo.LinkInfo.VolumeID.VolumeLabel
                    'Drive s/n'       = if(!!$ShotcutInfo.LinkInfo.VolumeID.DriveSerialNumber){"0x$($ShotcutInfo.LinkInfo.VolumeID.DriveSerialNumber.ToString('X'))"}else{}
                    'Local Path'      = $ShotcutInfo.LinkInfo.LocalBasePath
                    'Target Path'     = $ShotcutInfo.LinkTargetIDList.Path
                    Valid		      = $valid
                    'Working Dir.'    = $ShotcutInfo.StringData.WorkingDir
                    CreationTime      = [DateTime]::FromFiletime($ShotcutInfo.creationTime)
                    AccessTime        = [DateTime]::FromFiletime($ShotcutInfo.creationTime)
                    WriteTime         = [DateTime]::FromFiletime($ShotcutInfo.creationTime)
                    'Machine ID'      = $ShotcutInfo.ExtraData.TrackerDataBlock.MachineID
                    'Guid 1'          = if(!!$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid){$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid[0].ToUpper()}else{}
                    'Birth Guid 1'    = if(!!$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid){$ShotcutInfo.ExtraData.TrackerDataBlock.DroidBirth.guid[0].ToUpper()}else{}
                    'Guid 2'          = if(!!$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid){$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid[1].ToUpper()}else{}
                    'Birth Guid 2'    = if(!!$ShotcutInfo.ExtraData.TrackerDataBlock.Droid.guid){$ShotcutInfo.ExtraData.TrackerDataBlock.DroidBirth.guid[1].ToUpper()}else{}
                    'Icon Location'   = $ShotcutInfo.StringData.IconLocation
                    'Icon Path'       = $ShotcutInfo.ExtraData.IconEnvironmentDataBlock.TargetUnicode
                    'Icon Idx'        = $ShotcutInfo.IconIndex
                    'Command Args'    = $ShotcutInfo.StringData.CommandLineArguments
                    } 
            }
            catch{}      
}
# Show select results
$linktargets|sort -Property writetime -Descending|Format-Table -property Valid, WriteTime, 'Shortcut File', 'Local Path' -AutoSize -Wrap

